Since number of molecules = number of molecules x number of moles x Avogadro's constant
\[
\begin{array}{l}
\mathrm{C}_{2} \mathrm{H}_{5} \mathrm{OH}=1 \times 1 \times 6.022 \times 10^{23}=6.022 \times 10^{23} \text { molecules } \\
\qquad \mathrm{CH}_{3}=1 \times 1 \times 6.022 \times 10^{23}=6.022 \times 10^{23} \mathrm{molecules}
\end{array}
\]

sum of (number of atoms of each type of atom x molar mass of that atom)
\[
\begin{array}{rl}
\left(\mathrm{NH}_{4}\right)_{3} \mathrm{PO}_{4} & 3 \mathrm{N} \times 14.01 \mathrm{g} / \mathrm{mol}=42.03 \,\mathrm{g} / \mathrm{mol} \\
&12 \mathrm{H} \times 1.008 \mathrm{g} / \mathrm{mol}=12.096 \,\mathrm{g} / \mathrm{mol} \\
& \,\,\,1 \mathrm{P} \times 30.97 \mathrm{g} / \mathrm{mol}=30.97 \, \mathrm{g} / \mathrm{mol} \\
& 4 \mathrm{O} \times 16.00 \mathrm{g} / \mathrm{mol}=64.00 \,\mathrm{g} / \mathrm{mol}  \\
\hline &\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\,\, \mathrm{Sum}=149.096 \mathrm{g} / \mathrm{mol}
\end{array}
\]

For powers greater than hundred, just divide last two parts by 4 and get the remainder. For 1937. just divide 37 by 4 the remainder will be 1 so answer is i
\begin{array}{|c|c|c|c|c|}
\hline \text { Remainder } & 0 & 1 & 2 & 3 \\
\hline \text { Answer } & 1 & i & -1 & -i \\
\hline
\end{array}

 Simplifying even power of complex number and its conjugate always cancel out imaginary parts, so
\[
\begin{array}{c}
-1^{4}+^{4} C_{1}(-1)^{3}(\sqrt{3} i)+^{4} C_{2}(-1)^{2}(\sqrt{3} i)^{2}+^{4} C_{3}(-1)(\sqrt{3} i)^{3}+(\sqrt{3} i)^{4}+-1^{4}+^{4} C_{1}(-1)^{3}(-\sqrt{3} i)+^{4} C_{2}(-1)^{2}(-\sqrt{3} i)^{2}+^{4} C_{3}(-1)(-\sqrt{3} i)^{3}+(-\sqrt{3} i)^{4}
\end{array}
\]
Red parts will cancel each other and all the remaining parts are real,
\[
=1+6(-3)+9+1+6(-3)+9=-16
\]

\[
\frac{18}{72}=\frac{1}{4} \rightarrow \frac{\sqrt{18}}{\sqrt{72}}=\sqrt{\frac{18}{72}}=\sqrt{\frac{1}{4}}=\frac{1}{2}
\]

